from Crypto.Util.number import *
from secret import FLAG
import random

p = getPrime(1024)
q = getPrime(1024)
n = p*q
e = 5

# Some random padding
def pad(msg):
    msg = msg + b"\x00" + bytes(random.choices(range(1,256),k=5))
    return bytes_to_long(msg)

if __name__ == "__main__":
    print(n)
    for i in range(2):
        plaintext = pad(FLAG)
        print(pow(plaintext,e,n))

